import React from 'react';
import styled from 'styled-components';

const Foot = styled.footer`
  text-align: center; padding: 2rem;
  font-size: 0.9rem; color: ${({ theme }) => theme.text}99;
`;

export default () => (
  <Foot>© {new Date().getFullYear()} Mario Stroeykens – mariostroeykens.com</Foot>
);
